import './header.css';

function Headerbanner(){
  return(
    <>
      <a>company logo</a>
      <a className='flushedright'>search</a>
      <a className='flushedright'>listings</a>
      <a className='flushedright'>favourites</a>
      <a className='flushedright'>profile</a>
    </>
  );
}

export default Headerbanner;
